import React, {useEffect, useState} from "react";
import './App.css';

function FlightCount (props) {
  const NEO_KEY = "WMtTrqwesceUk1odHg4uWnSjNH2FMdWVQdw0h6zG";
  const request = 'https://api.nasa.gov/neo/rest/v1/neo/browse?api_key={NEO_KEY}';

  const [counter, setCounter] = useState(0);

  useEffect(() => {
    getNEOs();
  }, []);

  const getNEOs = async () => {
    const response = await fetch(request);
    const data = await response.json();
    console.log(data);
  }

  return (
     <button onClick={()=> setCounter(counter + 1)} className="flight_count" type="submit">
        <h1> Find current NEO list </h1>
        {counter}
     </button>
   );
}

export default FlightCount;
